import React from 'react';

function Login() {
	return (
		<div>
			<header>
				<nav className='w-full navbar bg-base-300 flex items-center'>
					<h1 className='text-xl font-bold'>Music Studio</h1>
				</nav>
			</header>
			<h1>Login</h1>
		</div>
	);
}

export default Login;
